import { GoogleMap, MarkerF, PolygonF, useJsApiLoader } from '@react-google-maps/api';
import React, { useCallback, useRef } from 'react';

const containerStyle = {
  width: '100%',
  height: '600px',
};

// Center point set to Jharkhand level
const center = {
  lat: 23.6102,  // Latitude of Jharkhand
  lng: 85.2799,  // Longitude of Jharkhand
};

const zoomLevel = 6;  // Initial zoom level for a broader view

// Coordinates for the Jharkhand polygon
const jharkhandCoords = [
  { lat: 24.4366, lng: 84.2201 },
  { lat: 24.1851, lng: 85.0568 },
  { lat: 23.9867, lng: 85.6182 },
  { lat: 23.6255, lng: 86.4194 },
  { lat: 23.1986, lng: 86.8941 },
  { lat: 22.7767, lng: 86.6826 },
  { lat: 22.3571, lng: 85.9870 },
  { lat: 22.2786, lng: 85.3999 },
  { lat: 22.7027, lng: 84.8895 },
  { lat: 23.1097, lng: 84.6137 },
  { lat: 23.7197, lng: 84.4003 },
  { lat: 24.0020, lng: 84.4666 },
];

// Coordinates for the Ranchi polygon (updated)
const ranchiCoords = [
  { lat: 23.5000, lng: 85.4631 },
  { lat: 23.4811, lng: 85.4194 },
  { lat: 23.4275, lng: 85.4325 },
  { lat: 23.4092, lng: 85.4611 },
  { lat: 23.4114, lng: 85.4986 },
  { lat: 23.4381, lng: 85.5059 },
  { lat: 23.4653, lng: 85.5097 },
  { lat: 23.4919, lng: 85.5140 },
  { lat: 23.5075, lng: 85.4816 },
  { lat: 23.5041, lng: 85.4472 },
  { lat: 23.4905, lng: 85.4158 },
];

// Coordinates for the new polygon
const newPolygonCoords = [
  { lat: 23.4422, lng: 85.4495 },  // 23°26'32"N 85°26'58"E
  { lat: 23.4383, lng: 85.4625 },  // 23°26'18"N 85°27'45"E
  { lat: 23.4381, lng: 85.4700 },  // 23°26'17"N 85°28'12"E
  { lat: 23.4472, lng: 85.4706 },  // 23°26'50"N 85°28'23"E
  { lat: 23.4511, lng: 85.4675 },  // 23°27'04"N 85°28'03"E
  { lat: 23.4508, lng: 85.4589 },  // 23°27'03"N 85°27'32"E
  { lat: 23.4444, lng: 85.4562 },  // 23°26'44"N 85°27'14"E
];

// Coordinates for Casa Blanca in Ormanjhi
const casaBlancaCoords = { lat: 23.442592425229485, lng: 85.4608527 };

const MapComponent = () => {
  const { isLoaded } = useJsApiLoader({
    id: 'google-map-script',
    googleMapsApiKey: "AIzaSyChN074R5gt4BfPTFox9UXnND0S8yyH6Dk", // Replace with your Google Maps API key
  });

  const mapRef = useRef(null);  // Using useRef instead of state to store map instance

  // Save the map instance when loaded
  const onLoad = useCallback((mapInstance) => {
    console.log("Map loaded:", mapInstance);
    mapRef.current = mapInstance;  // Store map instance in ref
  }, []);

  // Zoom in and fit the polygon's bounds when clicked
  const handlePolygonClick = useCallback((polygonCoords) => {
    const map = mapRef.current;
    if (!map) {
      console.log("Map instance not available.");
      return;
    }

    console.log("Polygon clicked, zooming in...");

    const bounds = new window.google.maps.LatLngBounds();
    polygonCoords.forEach(coord => bounds.extend(coord));

    map.fitBounds(bounds);  // Fit the bounds of the polygon

    // After fitting bounds, ensure zoom is in and set it to a defined zoom level (e.g., 12)
    const newZoom = 12;  // Set zoom to a specific level (12 is usually good for city-level zoom)
    map.setZoom(newZoom);  // Set the zoom level after fitting the bounds
  }, []);

  return isLoaded ? (
    <div style={{ position: 'relative' }}>
      <GoogleMap
        mapContainerStyle={containerStyle}
        center={center}
        zoom={zoomLevel}
        onLoad={onLoad}
      >
        {/* Jharkhand Polygon */}
        <PolygonF
          paths={jharkhandCoords}
          options={{
            fillColor: '#00FF00',
            strokeColor: '#000000',
            fillOpacity: 0.5,
          }}
          onClick={() => {
            console.log("Jharkhand polygon clicked");
            handlePolygonClick(jharkhandCoords);  // Zoom into Jharkhand when clicked
          }}
        />

        {/* Ranchi Polygon */}
        <PolygonF
          paths={ranchiCoords}
          options={{
            fillColor: '#FF5733',
            strokeColor: '#000000',
            fillOpacity: 0.5,
          }}
          onClick={() => {
            console.log("Ranchi polygon clicked");
            handlePolygonClick(ranchiCoords);  // Zoom into Ranchi when clicked
          }}
        />

        {/* New Polygon */}
        <PolygonF
          paths={newPolygonCoords}
          options={{
            fillColor: '#0000FF',
            strokeColor: '#000000',
            fillOpacity: 0.5,
          }}
          onClick={() => {
            console.log("New polygon clicked");
            handlePolygonClick(newPolygonCoords);  // Zoom into new polygon when clicked
          }}
        />

        {/* Casa Blanca Marker */}
        <MarkerF
          position={casaBlancaCoords}
          title="Casa Blanca Ormanjhi"
        />
      </GoogleMap>
    </div>
  ) : <></>;
};

export default MapComponent;
